import Ninjas from "./Ninjas";

function App() {
  state = {
    ninjas: [
      {
        name: "nihar1",
        age: 31,
        belt: "black",
        id: 1,
      },
      {
        name: "nihar2",
        age: 234234,
        belt: "safdasd",
        id: 2,
      },
    ],
  };
  return (
    <div className="App">
      <h1>Tis working!</h1>
      <Ninjas></Ninjas>
    </div>
  );
}

export default App;
